import React from 'react';
import topstrip from './images/top-strip.jpg';

import {Container,Row,Col, Jumbotron} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';


function Head(){
   return(
    <Jumbotron>
        <Container fluid>
            <Row>
                <Col>1 of 1</Col>
                <Col>2 of 2</Col>
            </Row>
        </Container>
    </Jumbotron>
   ) ;
}
export default Head;
